import React, { Component } from "react";

class LoginForm extends Component {
  render() {
    return (
      <>
        <form>
          Username: <input></input>
          <br />
          Password: <input></input>
          <br />
          <br />
          <button>Login</button>
        </form>
        ;
      </>
    );
  }
}

export default LoginForm;
